import React, { Component } from 'react';
import axios from 'axios'
import Map from './Map'


export default class axiosProp extends Component {
    state = {
        prop: []
    }

    componentDidMount() {
        axios.get('http://localhost:3001/propiedades')
            .then(res => {
                const prop = res.data.filter(item => item.id.includes(this.props.value));
                this.setState({ prop });
            })
    }

    render() {
        const { prop } = this.state
        const zoomP = 13
        const heightP = 300
        const prefijo = "PROPIEDAD"
        const text = "Consultar por la Propiedad"

        return (
            <>
                        {prop.map(item => {
                                return (
                                    <div key={item.id}>
                                        <h1>
                                            {item.tittle}
                                        </h1>
                                        <Map
                                            position={item.coordenadasP}
                                            zoom={zoomP}
                                            popup={item.tittle}
                                            height={heightP}
                                        />
                                    </div>
                                )

                        })}
            </>
        )
    }
}
